    "2013-03-15T23:37:26.515026",nt"name": "the-geology-of-the-st-johnsbury-quadrangle-vermont-and-new-hampshire",nt"isopen":
    false,nt"url": null,nt"notes": "This resource is available as a downloadable
    file, ESRI Service, and as a Web Feature service. Resource includes a Bedrock map,
    Lineations map, Tectonic map, Quarry map, Cross Section, and a text for Bedrock
    geology for the Geology of the St. Johnsbury quadrangle, Vermont and New Hampshire.
    For more information see links provided. Abstract: Metamorphosed sedimentary and
    volcanic rocks of Ordovieian,  Silurian and/or Devonian age underlie the St. Johnsbury
    quadrangle. The Ordovician rocks are part of the New Flampshire sequence and have
    been assigned to two formations, the Albee and Ammonoosue. The  Albee formation
    consists of 4,000 feet of slate, quartz-mica schist, micaceous quartzite, and quartzite.
    The Ammonoosnc volcanics are chiefly metamorphosed soda rhyolite tuffs and  flows,
    with  some black slate and quartz-mica schist.",nt"license_title": null,nt"extras":
